import React from "react";
import { Link } from "react-router-dom";

const Header=()=>{

    return(
        <header>
            <div>My portfolio</div>
            <nav>
                <ul>
                    <li>
                        <Link to='/Projects'>Projects</Link>
                    </li>
                    <li>
                        <Link to='/Experience'>Experience</Link>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default Header
